import Link from "next/link";
const Navbar = () => {
  const Styles = {
    display: "flex",
    background: "grey",
    justifyContent: "space-between",
    padding: "1rem",
  };
  return (
    <div style={Styles}>
      <Link href="/about">
        <a>About page</a>
      </Link>
      <Link href="/contact">
        <a>Contact Page</a>
      </Link>
    </div>
  );
};

export default Navbar;
